

var App = {
	
	'disk' : null,
	
	'sockets' : {},
	
	'init' : function() {
		
		App.disk = new Disk('data');
		
		App.initSockets();
			
	},
	
	'initSockets' : function() {
		
		var dataSocket = App.sockets.data = io.connect('http://localhost:8080/data');
		
		dataSocket.on('connect',function() {
			var blocks = App.disk.getBlockKeys();
			dataSocket.emit('init',{
				'blocks' : blocks,
				'space' : {
					'total' : App.disk.getTotalSpace(),
					'free' : App.disk.getFreeSpace()
				}
			});
			
			//App.setData('image','%3D');
			console.log('startGetData');
			var startTime = (new Date()).getTime()/1000;
			App.getData('image',function(data) {
				console.log('getData : '+(((new Date()).getTime()/1000)-startTime).toFixed(2)+'sec.');
				//console.log(data);
				$('body').append('<img src="data:image/jpeg;base64,'+data+'" />');
			});
		});
		
		dataSocket.on('get',function(key,callback) {
			console.log('onGet');
			var data = App.disk.get(key);
			console.log(data);
			callback(data);
		});
		
		dataSocket.on('set',function(key,data,callback) {
			console.log('onSet');
			console.log(arguments);
			App.disk.set(key,data);
			callback({
				'total' : App.disk.getTotalSpace(),
				'free' : App.disk.getFreeSpace()
			});
		});
		
	},
	
	'setData' : function(key,data) {
		
		var dataSocket = App.sockets.data;
		
		dataSocket.emit('set',key,data);
		
	},
	
	'getData' : function(key,callback) {
		
		var dataSocket = App.sockets.data;
		
		dataSocket.emit('get',key,callback);
		
	}
	
	
	
};



